import React from 'react'
import { Link, Route, Switch,BrowserRouter as Router}  from 'react-router-dom';

class Menu extends React.Component{
    render()
    {
        return (
            
        <nav className="navbar navbar-expand-sm bg-dark navbar-dark align-bottom" id="toolsty">
            <ul className="navbar-nav">
                <li className="nav-item">
                    <Link className="nav-link" to="/">ראשי</Link>
                </li>

                <li className="nav-item">
                    <Link className="nav-link" to="/">אודות</Link>
                </li>

                <li className="nav-item">
                    <Link className="nav-link" to="/ContactUs">צור קשר</Link>
                </li>

                <li className="nav-item">
                    <Link className="nav-link" to="/">התחברות</Link>
                </li>
            </ul>
        </nav>
        );
    }
}

export default Menu;

